import React, { useState } from "react";
import logo from "../Images/food.png";
import admin from "../Images/Admin.png";
import axios from "axios";
import { toast } from "react-toastify";
import { Link, useNavigate } from "react-router-dom";

const Login = () => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [isLoading, setIsLoading] = useState(false);
    const [showPassword, setShowPassword] = useState(false);
    const navigate = useNavigate();

    const handleLogin = async (e) => {
        e.preventDefault();
        setIsLoading(true);
    
        try {
            const response = await axios.post(
                `${process.env.REACT_APP_BASE_API_URL}/api/Auth/login`,
                { email, password },
                {
                    headers: {
                        "Content-Type": "application/json",
                    },
                }
            );
    
            // ‡πÄ‡∏Å‡πá‡∏ö Token ‡πÑ‡∏ß‡πâ‡πÉ‡∏ô localStorage
            localStorage.setItem("authToken", response.data.Token);
    
            // Logic ‡∏™‡∏≥‡∏´‡∏£‡∏±‡∏ö‡∏ô‡∏≥‡∏ó‡∏≤‡∏á (redirect) ‡∏ï‡∏≤‡∏° Role
            const decoded = JSON.parse(atob(response.data.Token.split(".")[1]));
            const userRole = decoded.role;
            if (userRole === "admin") {
                navigate("/select-branch");
            } else {
                navigate("/sale");
            }
        } catch (error) {
            toast.error(error.response?.data?.Message || "Unable to login.");
        } finally {
            setIsLoading(false);
        }
    };

    return (
        <div className="login-register-container">
        <div className="logo">
            <img src={logo} alt="App Logo" />
        </div>
        <div className="form-container">
            <img src={admin} className="avatar" alt="Admin Avatar" />
            <form onSubmit={handleLogin}>
            {/* ‡∏ä‡πà‡∏≠‡∏á Email */}
            <input
            type="text-form"
            placeholder="Email..."
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            className="form-input"
            />

            {/* ‡∏ä‡πà‡∏≠‡∏á Password */}
            <div className="input-group">
            <input
                type={showPassword ? "text" : "password"} // ‡∏ã‡πà‡∏≠‡∏ô‡∏´‡∏£‡∏∑‡∏≠‡πÅ‡∏™‡∏î‡∏á‡∏£‡∏´‡∏±‡∏™‡∏ú‡πà‡∏≤‡∏ô
                placeholder="Password..."
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
                className="form-input"
            />
            <button
                type="button"
                onClick={() => setShowPassword(!showPassword)} // ‡∏™‡∏•‡∏±‡∏ö‡∏™‡∏ñ‡∏≤‡∏ô‡∏∞ Show/Hide
                className="show-password-btn"
            >
                {showPassword ? "Hide" : "Show"}
            </button>
            </div>
            <button type="submit" className="btn" disabled={isLoading}>
                {isLoading ? "Processing..." : "Login"}
            </button>
            </form>
            <p>
            Don't have an account? <Link to="/register">Register here</Link>
            </p>
        </div>
        </div>
    );
};

export default Login;
